import React, { useState } from 'react';
import './Sell.css';

const Sell = () => {
  const [step, setStep] = useState(1);
  const [personalInfo, setPersonalInfo] = useState({
    name: '',
    surname: '',
    email: '',
    phone: '',
    password: ''
  });

  const [carDetails, setCarDetails] = useState({
    manufacturer: '',
    model: '',
    year: '',
    mileage: '',
    fuelType: '',
    engine: '',
    horsepower: '',
    kwh: '',
    transmission: '',
    driveType: '',
    exteriorColor: '',
    interiorColor: '',
    interiorMaterial: '',
    doors: '',
    features: {
      sunroof: false,
      seatWarmers: false,
      parkingSensors: false,
      backupCamera: false,
      bluetooth: false,
      heatedSeats: false
    }
  });

  const handleNext = () => setStep(2);
  const handleBack = () => setStep(1);

  const handleInputChange = (e) => {
    setPersonalInfo({
      ...personalInfo,
      [e.target.name]: e.target.value
    });
  };

  const handleCarDetailsChange = (e) => {
    setCarDetails({
      ...carDetails,
      [e.target.name]: e.target.value
    });
  };

  const handleFeatureChange = (feature) => {
    setCarDetails({
      ...carDetails,
      features: {
        ...carDetails.features,
        [feature]: !carDetails.features[feature],
      }
    });
  };

  return (
    <div className="sell-page">
      {step === 1 && (
        <div className="get-started">
          <h2>Get Started</h2>
          <p>Enter your personal information to start selling a car.</p>
          <div className="personal-info">
            <input type="text" name="name" placeholder="Name" value={personalInfo.name} onChange={handleInputChange} />
            <input type="text" name="surname" placeholder="Surname" value={personalInfo.surname} onChange={handleInputChange} />
            <input type="email" name="email" placeholder="Email" value={personalInfo.email} onChange={handleInputChange} />
            <input type="tel" name="phone" placeholder="Phone Number" value={personalInfo.phone} onChange={handleInputChange} />
            <input type="password" name="password" placeholder="Password" value={personalInfo.password} onChange={handleInputChange} />
          </div>
          <button onClick={handleNext} className="next-button">Next: Car Details</button>
        </div>
      )}

      {step === 2 && (
        <div className="car-details">
          <h2>Car Details</h2>
          <div className="car-info">
            <input type="text" name="manufacturer" placeholder="Manufacturer" value={carDetails.manufacturer} onChange={handleCarDetailsChange} />
            <input type="text" name="model" placeholder="Model" value={carDetails.model} onChange={handleCarDetailsChange} />
            <input type="number" name="year" placeholder="Year" value={carDetails.year} onChange={handleCarDetailsChange} />
            <input type="number" name="mileage" placeholder="Mileage (km)" value={carDetails.mileage} onChange={handleCarDetailsChange} />
            <input type="text" name="fuelType" placeholder="Fuel Type" value={carDetails.fuelType} onChange={handleCarDetailsChange} />
            <input type="text" name="engine" placeholder="Engine" value={carDetails.engine} onChange={handleCarDetailsChange} />
            <input type="number" name="horsepower" placeholder="Horsepower (HP)" value={carDetails.horsepower} onChange={handleCarDetailsChange} />
            <input type="number" name="kwh" placeholder="kWh (if electric)" value={carDetails.kwh} onChange={handleCarDetailsChange} />
            <input type="text" name="transmission" placeholder="Transmission" value={carDetails.transmission} onChange={handleCarDetailsChange} />
            <input type="text" name="driveType" placeholder="Drive Type" value={carDetails.driveType} onChange={handleCarDetailsChange} />
            <input type="text" name="exteriorColor" placeholder="Exterior Color" value={carDetails.exteriorColor} onChange={handleCarDetailsChange} />
            <input type="text" name="interiorColor" placeholder="Interior Color" value={carDetails.interiorColor} onChange={handleCarDetailsChange} />
            <input type="text" name="interiorMaterial" placeholder="Interior Material" value={carDetails.interiorMaterial} onChange={handleCarDetailsChange} />
            <input type="number" name="doors" placeholder="Number of Doors" value={carDetails.doors} onChange={handleCarDetailsChange} />

            {/* Car Features */}
            <div className="features">
              <label>
                <input type="checkbox" checked={carDetails.features.sunroof} onChange={() => handleFeatureChange('sunroof')} />
                Sunroof
              </label>
              <label>
                <input type="checkbox" checked={carDetails.features.seatWarmers} onChange={() => handleFeatureChange('seatWarmers')} />
                Seat Warmers
              </label>
              <label>
                <input type="checkbox" checked={carDetails.features.parkingSensors} onChange={() => handleFeatureChange('parkingSensors')} />
                Parking Sensors
              </label>
              <label>
                <input type="checkbox" checked={carDetails.features.backupCamera} onChange={() => handleFeatureChange('backupCamera')} />
                Backup Camera
              </label>
              <label>
                <input type="checkbox" checked={carDetails.features.bluetooth} onChange={() => handleFeatureChange('bluetooth')} />
                Bluetooth
              </label>
              <label>
                <input type="checkbox" checked={carDetails.features.heatedSeats} onChange={() => handleFeatureChange('heatedSeats')} />
                Heated Seats
              </label>
            </div>
          </div>
          <button onClick={handleBack} className="back-button">Back</button>
          <button className="submit-button">Submit Listing</button>
        </div>
      )}
    </div>
  );
};

export default Sell;
